import React from 'react'
import {foto} from '../../images/logo7.jpg'
import './Ekonomiapage.js'
function EkonomiPage() {
  return (
    <div className='another-page'>
       
        <h1 className='user-value'>Kosova dhe Unioni Arab me bashkëpunim e rekomandime për ndryshimet klimatike
</h1> <br />
         <div className='user-img'><img src={foto}/></div> 
        <div className='user-body'>{user?.body}</div> <br />   
   
        
    </div>
  )
}

export default EkonomiPage;
